import React from "react";
import { makeStyles } from "@material-ui/styles";

const styles = ({
    circle: {
        width: 100,
        height: 100,
        borderRadius: 100/2,
        backgroundColor: 'red'
    }
});

export default function Dot(){
    return(
        <View style={styles.circle} />
    )
}
